sourcesContent:
const awsmobile = {
  aws_project_region: "us-west-2", // Replace with your AWS region
  aws_cognito_identity_pool_id:
    "us-west-2:3c1efe0a-3ff9-4b0d-a1a6-4f5e701237fa", // Replace with your Identity Pool ID
  aws_cognito_region: "us-west-2", // Same as aws_project_region
  aws_user_pools_id: "your-user-pool-id", // Replace with your User Pool ID
  aws_user_pools_web_client_id: "your-web-client-id", // Replace with your Web Client ID
  aws_appsync_region: "us-west-2", // Replace with your AppSync region
  aws_appsync_authenticationType: "AMAZON_COGNITO_USER_POOLS", // Assuming you use Cognito for auth
  aws_appsync_apiKey: "your-appsync-api-key", // If you use API_KEY authentication

  // Database settings (if applicable)
  aws_rds_db_instance_arn: "", // Replace with your RDS instance ARN
  aws_rds_db_instance_database_name: "", // Replace with your database name
  aws_rds_db_instance_database_username: "", // Replace with your database username
  aws_rds_db_instance_database_password: "", // Replace with your database password

  // S3 settings
  aws_s3_bucket: "mogulvideo", // Replace with your S3 bucket name
  aws_s3_bucket_region: "us-west-2", // Replace with your S3 bucket region
};

export default awsmobile;
